        "show": "Zobrazit",
        "info0_network": "Nastavení sítě\r\n<p> <p>\r\nPokud vaše zařízení přijalo informace ze serveru DHCP, zobrazí se zde jako výchozí hodnoty.\r\n<dl>\r\n<dt> Adresa IPv4 </dt> <dd> Adresa IPv4 prvního rozhraní (ETH0). Ujistěte se, že zadaná vámi adresa ještě není ve vaší síti používána. \r\n<p> <p>\r\nPokud ponecháte pole adresy prázdné, PBX získá vlastní IP adresu a možnost dalšího nastavení konfigurace prostřednictvím DHCP. V tomto případě se ujistěte, že byla na vašem serveru DHCP vytvořena  <q> rezervace </q>. To je důležité, protože adresu nelze časem měnit. MAC adresa PBX ústředny je <q> sériové číslo </q> umístěné na zařízení. \r\n</dd>\r\n<dt> IPv4 maska sítě </dt> <dd> Maska podsítě rozhraní ETH0\r\n(např. <code> 255.255.255.0 </code>) </dd>\r\n<dt> Výchozí směrovač </dt> <dd> Standardní směrovač vaší sítě. Tam bude odeslán IP traffic z neznámé pro ústřednu destinace. </dd>\r\n<dt> Adresa serveru DNS </dt> <dd> Server pro rozlišení doménových jmen vaší sítě. Ústředna PBX posílá všechny názvy služeb a jména poskytovatelů (např. poskytovatele SIP) na server DNS, aby zjistila jejich příslušné adresy IP. </dt>\r\n<dt> Adresa serveru NTP </dt> <dd> Síťový časový protokol (např. <code> pool.ntp.org </code>). PBX nebude správně fungovat bez správného časového serveru\r\n</dd>\r\n</dl> \r\n",
        "info0_update": "Aktualizace\r\n<ul>\r\npro aktualizaci vašého zařízení vyberte hlavní verzi firmwaru\r\n</ul>\r\n",
        "info0_devices": "Přidat do stávající instalace\r\n<ul>\r\nNázev cesty, pokud aplikace nemají být instalovány na tomto zařízení, ale na jiné App Platformě (např. <code>https://meineZentralePBX/App/</code>\r\n</ul>",
        "info0_localap": "Instalace lokální App Platformy \r\n<dl>\r\n<dt> Adresa IPv4 </dt>\r\n<dd>\r\nIP adresa nové App Platformy.\r\n<p> <p> Pokud ponecháte pole adresy prázdné, App Platforma získá vlastní IP adresu a možnost dalšího nastavení konfigurace prostřednictvím DHCP. V tomto případě se ujistěte, že byla na vašem serveru DHCP vytvořena <q> rezervace </q> pro vaši App Platformu. Toto je důležité, protože adresu nelze změnit. Mac adresa App Platformy je <q> sériové číslo </q> umístěné na zařízení s prvními dvěma číslicemi <code> 00 </code> namísto <code> 02 </code>.\r\n</dd>\r\n</dl>\r\n<p> <p>\r\nApp Platforma vždy vyžaduje vlastní IP adresu.\r\n",
        "info1_appconnect": "App Platforma nastavení\r\n<ul>\r\nApp Platforma je ve fázi instalace. V závislosti na zařízení může tento proces nějakou dobu trvat.\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "První uživatelský účet s administrátorskými právy\r\n<p>\r\nNakonfigurujte osobní účet pro prvního uživatele, který má administrátorská práva. To můžete být například vy. \r\n<dl>\r\n<dt> Uživatelské jméno </dt>\r\n<dd> Úplné a jedinečné jméno uživatele, například vaše vlastní jméno a příjmení. </dd>\r\n<dt> E-mailová adresa </dt>\r\n<dd> E-mailová adresa, kterou lze použít k odeslání e-mailu uživateli. Můžete například zadat svou vlastní e-mailovou adresu. </dd>\r\n<dt>Účet</dt> <dd> Přihlašovací jméno. Zde můžete použít lokální část vlastní e-mailové adresy (tj. Vše před <q> @ </q>) bez zvláštních znaků nebo velkých písmen, pouze písmena a až z, 0 až 9 a speciální znaky.! # $% & '* + - / =? ^ _ `{|} ~ jsou povoleny. </dd>\r\n<dt>Heslo</dt> <dd> Heslo pro přihlášení. </dd>\r\n</dl>\r\n",
        "info3_pbxident": "Identifikace PBX ústředny\r\n<dl> <dt>\r\nJméno domény\r\n</dt> <dd>\r\nZde zadejte <q> název domény </q> zákazníka. Jsou povoleny pouze znaky  .  a -  a písmena  a až z, 0 až 9 (bez velkých písmen).\r\n</dd> <dt>\r\nNázev místa pobočkové ústředny PBX\r\n</dt> <dd>\r\nPopište umístění této PBX ústředny. Zde má smysl uvést název města jako např.  <q> berlin </q>. Stejně jako název domény, jsou povoleny pouze písmena a až z, 0 až 9 a znaky .  a  -  (bez velkých písmen)\r\n</dd>\r\n</dl>\r\n",
        "info3_pbxdns": "Názvy domén \r\n<p>\r\nNázvy DNS pro PBX ústřednu a App Platformu, které byly nakonfigurovány na vašem serveru DNS.\r\n<p>\r\nInstalační program ověří, že tyto názvy byly nastaveny na vašem DNS serveru a ukazují na správné zařízení (tj. IP adresu). Pokud ještě nejsou nastaveny ve vašem DNS, můžete je nechat prázdné a pokračovat v instalaci. Doporučujeme však nechat si je nastavit dříve, abyste si mohli být jisti, že je vše správné a funguje.\r\n<dl>\r\n<dt> DNS jméno pro tuto ústřednu PBX </dt>\r\n<dd> Název DNS, který byl nastaven pro PBX ústřednu. Musí ukazovat na IP adresu vaší PBX ústředny. Doporučujeme použít výchozí hodnoty uvedené pro název DNS. V každém případě pouze písmena a až z, 0 až 9 a znaky . a - jsou povoleny (bez velkých písmen). </dd>\r\n<dt> Název DNS App Platformy </dt>\r\n<dd> Název DNS, který byl nastaven pro App Platformu. Musí odkazovat na IP adresu vaší App Platformy. Pokud jde o PBX ústřednu, pouze písmena a až z, 0 až 9 a znaky . a - jsou povoleny (bez velkých písmen) </dd>\r\n</dl>\r\nPokud byla změněna položka DNS ve vašem serveru DNS, může se stát, že vyrovnávací paměť DNS ve vašem prohlížeči a operační systém musí být vymazána, aby se změna projevila v instalaci.\r\n",
        "info3_pbxvoicemail": "Pomocí ovládacích políček vyberte, které jazyky jsou pro hlasovou schránku vyžadovány. Instalujte pouze jazyky, které jsou pro zákazníka skutečně potřebné.",
        "info4_showpwd": "Tato hesla se obvykle nepoužívají. Nicméně v případě nouze (například, pokud jste zapomněli uživatelské heslo s administrátorskými právy), budete je potřebovat. Ujistěte se, že jste je poznamenali a umístili na bezpečné místo!",
        "info5_installing": "Některé důležité aplikace se nyní instalují - může to chvíli trvat ...",
