        "setup": "innovaphone PBX wordt geïnstalleerd",
        "show": "Weergeven",
        "info0_network": "Netwerk instellingen\r\n<p> <p>\r\nAls uw apparaat informatie van uw DHCP-server heeft ontvangen, wordt dit hier standaard weergegeven.\r\n<dl>\r\n<dt> IPv4-adres </ dt> <dd> IPv4-adres van de ETH0-interface. Houd er rekening mee dat het nieuwe adres in het netwerk nog niet is gebruikt. Dit apparaat kan dan op dit adres worden bereikt. Deze weergave wordt automatisch naar dit nieuwe adres omgeschakeld.\r\n<p> <p>\r\nAls u het adres leeg laat, verkrijgt de PBX zijn IP-adres en eventuele andere opties d.m.v. DHCP. Zorg ervoor dat er een <q> reservering </ q> is aangemaakt op uw DHCP-server voor de PBX, omdat het adres niet mag veranderen. Het Mac-adres van het App-platform is het \"serienummer\" dat op het apparaat is afgedrukt. </ dd>\r\n<dt> IPv4-netmasker </ dt> <dd> Subnetmasker van de ETH0-interface\r\n(bijvoorbeeld <code> 255.255.255.0 </ code>) </ dd>\r\n<dt> Standaard router </ dt> <dd> De voor de PBX onbekende bestemmingen worden naar dit adres gestuurd. </ dd>\r\n<dt> DNS-serveradres </ dt> <dd> De DNS-server wordt gebruikt voor naam naar IP omzetting. De PBX verzendt voor alle namen van b.v. services of namen van SIP-providers een een aanvraag naar de DNS-server om het bijbehorende IP-adres te ontvangen. </ dt>\r\n<dt> NTP-serveradres </ dt> <dd> Tijdserveradres (Network Time Protocol, bijvoorbeeld <code> nl.pool.ntp.org </ code>). Correct functioneren van de PBX zonder datum en tijd is niet mogelijk!\r\n</ dd>\r\n</ dl>",
        "info0_update": "Update\r\n<ul>\r\nte installeren Firmwareversie\r\n</ul>\r\n",
        "info0_devices": "Toevoegen aan bestaande installatie\r\n<ul>\r\nPadnaam als de toepassingen niet op dit apparaat maar op een ander App-platform moeten worden geïnstalleerd (bijvoorbeeld <code> https: // myCentralPBX / app / </ code>\r\n</ ul>",
        "info0_localap": "Installeer lokaal App Platform\r\n<dl>\r\n<dt> IPv4-adres </ dt>\r\n<dd>\r\nAdres waaronder het App Platform op dit apparaat toegankelijk moet zijn.\r\n<p> <p> Als u het adres leeg laat, verkrijgt het App Platform het IP-adres en eventuele andere opties d.m.v. DHCP. Zorg ervoor dat er een <q> reservering </ q> is gemaakt voor het App-platform in uw DHCP-server, omdat het adres niet mag veranderen. Het Mac-adres van het App-platform is het serienummer dat op het apparaat is afgedrukt, behalve dat de eerste twee cijfers <code> 02 </ code> moeten zijn in plaats van <code> 00 </ code>.\r\n</ dd>\r\n</ dl>\r\n<P> <p>\r\nHet App Platform heeft altijd een eigen IP-adres nodig!",
        "info1_appconnect": "App Platform instellen\r\n<ul>\r\nHet App Platform wordt geïnstalleerd, afhankelijk van het apparaat kan dit enige tijd duren....\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "Eerste gebruikersaccount met beheerdersrechten\r\n<p>\r\nStel hier het persoonlijke account in voor de gebruiker die de beheerdersrechten dient te verkrijgen. Dit kan b.v. jezelf zijn.\r\n<dl>\r\n<dt> Gebruikersnaam </ dt>\r\n<dd> De volledige en unieke naam van de gebruiker, bijvoorbeeld je voor- en achternaam. </ dd>\r\n<dt> E-mailadres </ dt>\r\n<dd> Het e-mailadres waarmee de gebruiker een e-mail kan worden verzonden. Dus vul bijvoorbeeld je eigen e-mailadres in.\r\n<dt> Account </ dt> <dd> De inlognaam. Hier kun je bijvoorbeeld het <q> lokale deel </ q> van uw e-mailadres gebruiken, dus het gedeelte vóór het<q> @ </ q>, geen speciale tekens, geen hoofdletters, toegestaan zijn hier alleen a-z, 0-9 evenals de tekens. $% & '* + - / = ^ _ `{|} ~ </ dd>?\r\n<dt> Wachtwoord </ dt> <dd> Wachtwoord om in te loggen. </ dd>\r\n</ dl>",
        "info3_pbxident": "Identificatie van de PBX\r\n<dl> <dt>\r\nDomeinnaam\r\n</ dt> <dd>\r\nHier wordt de <q> domeinnaam </ q> van de klant ingevoerd. Hier zijn de tekens a-z, 0-9.- toegestaan (geen hoofdletters)\r\n</ dd> <dt>\r\nPBX-locatienaam\r\n</ dt> <dd>\r\nBeschrijft de locatie van deze PBX. Hier is b.v. een plaatsnaam als <q> Roermond </ q> logisch. Net als bij de <q> domeinnaam </ q> zijn de tekens a-z, 0-9.- hier toegestaan\r\n</ dd>\r\n</ dl>",
        "info3_pbxdns": "<dl>\r\n<dt>Domein namen</dt>\r\n<dd>Het gebruik van DNS vasstleggen</dd>\r\n<dt>DNS toepassen om met myApps te verbinden</dt>\r\n<dd>\r\nWanneer deze optie niet wordt gekozen, worden uitsluitend IP Adressen toegepast. Voor sommige toepassingen is DNS toegang vereist. b.v.\r\n<ul>\r\n<li>Toegang vanaf publiek internet zonder VPN via een Reverse Proxy</li>\r\n<li>Bij gebruik van certificaten, die door de browser automatisch geaccepteerd worden </li>\r\n</ul>\r\nOm achteraf op gebruik van DNS te wisselen, moeten in de URL's van de App Objecten, de IP-adressen door de DNS namen vervangen worden.\r\n</dd>\r\n<dt>DNS-naam van deze PBX</dt>\r\n<dd>De DNS-naam waarmee het IP-adres van deze PBX in de DNS Server vastgelegd is.  Bij voorkeur neem je het voorbeeld over. In elk geval zijn hier alleen de volgende tekens toegestaan a-z, 0-9, .  en - (geen hoofdletters)</dd>\r\n<dt>DNS-naam van het App Platform</dt>\r\n<dd>De DNS-naam waarmee het IP-adres van dit App Platform in de DNS Server vastgelegd is. Zoals bij de PBX zijn ook hier alleen de tekens a-z, 0-9, . en - toegestaan.</dd>\r\n</dl>\r\n<p>\r\nInstall test of deze namen in DNS gevonden worden en naar het apparaat verwijzen dat je zojuist configureert.  Wanneer deze test mislukt, omdat b.v. de DNS-records nog niet aanwezig zijn, kun je toch doorgaan, in een tijdelijke modus zonder DNS. Zodra de DNS-records aanwezig zijn dient de \"Operation without DNS\" checkmark (Advanced UI: PBX/Config/General), gewist te worden.\r\n</p>",
        "info3_pbxvoicemail": "Selecteer all gewenste talen voor het voicemailsysteem. Installeer alleen de talen die voor de klant van toepassing zijn en ondersteund dienen te worden.",
        "info4_showpwd": "Deze wachtwoorden zijn complexe, random gegenereerde wachtwoorden en alleen voor noodsituaties bedoeld. S.V.P. Deze opslaan op een veilige locatie!\r\nHet beheer van de apparaten en de PBX gebeurt via via een reguliere gebruikersaccount met beheerdersrechten.",
        "info5_installing": "Sommige belangrijke Apps worden nu automatisch geïnstalleerd - deze installatie kan enkele minuten duren.",
