        "setup": "innovaphone PBX is set up",
        "show": "show",
        "info0_network": "Network Settings\r\n<p><p>\r\nIf your device receives a lease from a DHCP server, all configuration options included in the lease are shown here as default values. \r\n<dl>\r\n<dt>IPv4 address</dt><dd>The IPv4 address of the first (ETH0) interface. Please make sure that the address you specify is not yet used in your network. \r\n<p><p>\r\nIf you leave the address field empty, the PBX will receive its IP address and possibly further options with DHCP. In this case, please make sure that a <q>reservation</q> has been set up for the device in your DHCP server.  This is important because the address must not change over time. The Mac address of the PBX is the <q>Serial number</q> printed on the device. \r\n</dd>\r\n<dt>IPv4 netmask</dt><dd>The subnet mask of the ETH0 interface \r\n(e.g. <code>255.255.255.0</code>)</dd>\r\n<dt>Default router</dt><dd>Your network's standard router.  IP traffic for destinations unknown to the PBX will be sent there</dd>\r\n<dt>DNS server address</dt><dd>Your network's domain name resolution server. The PBX will resolve names of services and hosts (e.g. your SIP provider) to the DNS server to learn their respective IP addresses.</dt>\r\n<dt>NTP server address</dt><dd>Your network's time server (e.g. <code>pool.ntp.org</code>). The PBX won't work correctly without a proper time server \r\n</dd>\r\n</dl>\r\n\r\n",
        "info0_update": "Update\r\n<ul>\r\nselect the major firmware version to update your device\r\n</ul>\r\n",
        "info0_devices": "Add to existing installation\r\n<ul>\r\nPath name if the applications shall not be installed on this device but on another app platform (e.g. <code>https://mycentralPBX/app/</code>\r\n</ul>\r\n",
        "info0_localap": "Install local App Platform \r\n<dl>\r\n<dt>IPv4 address</dt>\r\n<dd>\r\nIP address of the new app platform.\r\n<p><p>If you leave the address field empty, the App Platform will obtain its IP address and possibly further configuration settings via DHCP. In this case, please make sure that a <q>reservation</q> for your App Platform has been created in your DHCP server. This is important because the address must not change over time.  The Mac address of the App Platform is the <q>Serial number</q> printed on the device with the first two digits <code>00</code> replaced with <code>02</code>. \r\n</dd>\r\n</dl>\r\n<p><p>\r\nThe App Platform always requires a separate IP address.",
        "info1_appconnect": "App Platform setup\r\n<ul>\r\nThe App Platform is being installed. Depending on the device, this may take some time...\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "First user account with administration rights\r\n<p>\r\nConfigure the personal account for the first user who shall have administration rights. This can be yourself, for example. \r\n<dl>\r\n<dt>Display name</dt>\r\n<dd>The complete and unique name of the user, for example your own given name and surname.</dd>\r\n<dt>Email address</dt>\r\n<dd>The email address which can be used to send emails to the user. You can specify your own email address, for example.</dd>\r\n<dt>Account</dt><dd>The login name. You can use the local part of your own email address (that is, everything before the <q>@</q>) here. No capital or special characters, only letters a to z, 0 to 9 and the characters .!#$%&'*+-/=?^_`{|}~ are allowed.</dd>\r\n<dt>Password</dt><dd>Password for the login.</dd>\r\n</dl>",
        "info3_pbxident": "Identification of the PBX\r\n<dl><dt>\r\nDomain name\r\n</dt><dd>\r\nEnter the <q>domain name</q> of the customer here.  Letters a to z, 0 to 9, and the characters . and - are allowed (no capital letters).\r\n</dd><dt>\r\nPBX location name\r\n</dt><dd>\r\nSpecifies the location of the PBX. Here a town name such as <q>berlin</q> makes sense.  Like with the domain name, Letters a to z, 0 to 9, and the characters . and - are allowed (no capital letters)\r\n</dd>\r\n</dl>",
        "info3_pbxdns": "<dl>\r\n<dt>Domain names</dt>\r\n<dd>Define use of DNS</dd>\r\n<dt>Use DNS to access myApps</dt>\r\n<dd>\r\nIf this option is not set, only IP addresses are used. For some functions DNS is needed. E.g.:\r\n<ul>\r\n<li>Access from the public internet without VPN using a Reverse Proxy</li>\r\n<li>Usage of certificates, which are automatically accepted by the browsers</li>\r\n</ul>\r\nTo switch to usage of DNS later on, you have to replace the IP addresses in the URLs in the app objects, by the respective DNS names.\r\n</dd>\r\n<dt>DNS name of this PBX</dt>\r\n<dd>The DNS name that has been set up for the PBX. It must point to the IP address of your PBX. We recommend that you use the default values shown for the DNS name. In any case, only the letters a to z, 0 to 9 and the characters . and - are allowed (no capital letters).</dd>\r\n<dt>DNS name of the app platform</dt>\r\n<dd>The DNS name that has been set up for the app platform. It must point to the IP address of your app platform. As for the PBX, only the letters a to z, 0 to 9 and the characters . and - are allowed (no capital letters)</dd>\r\n</dl>\r\n<p>\r\nThe install verifies that the configured DNS names have been set up in your DNS server and point to the correct device. If they are not yet set up in your DNS, you can continue anyway, in a temporary mode without DNS. As soon as the DNS names are set in your infrastructure, you should clear the \"Operation without DNS\" checkmark (Advanced UI: PBX/Config/General).\r\n</p>\r\n",
        "info3_pbxvoicemail": "Select all the languages your voicemail system shall support.  ",
        "info4_showpwd": "These passwords are not used normally.  However, in an emergency case (for example, if you have forgotten the password for your users with administration rights), you will need them.  So make sure you take note and store them in a secure place!",
        "info5_installing": "Some important Apps are being installed now - this can take a while ...",
