        "twofactorauth": "Two-factor authentication",
        "info7_twofactorauth": "Two-factor authentication\r\n<dd>\r\n<q>Two-factor authentication</q> is used to enhance the security of the PBX by combining two different components (factors) for verification when a user logs in. This may for example be the combination of a password and an e-mail that is to be confirmed. We strongly recommend to activate two-factor authentication. \r\n</dd>\r\n",
