        "info8_email": "Email account\r\n<p>\r\nConfigure the account which will be used by the PBX to send emails to you.\r\n<dl>\r\n<dt>SMTP server</dt>\r\n<dd>Host name or IP address of your email server for outgoing mails (<q>SMTP-Server</q>)</dd>\r\n<dt>Email address</dt>\r\n<dd>The address which will be used as From: address in such mails. You can for example use your own email adress here. </dd>\r\n<dt>Email account</dt>\r\n<dd>The account name for the user</dd>\r\n<dt>Email password</dt>\r\n<dd>The password for the user</dd>\r\n<dt>Sender name</dt>\r\n<dd>An arbitrary name which will be used as sender name</dd>\r\n</dl>\r\nSend test email\r\n<p>\r\nTo verify your configuration data, you send a test E-mail\r\n<dl>\r\n<dt>Destination email address</dt>\r\n<dd>The email address where the test email should be sent to</dd>\r\n</dl>",
