        "setup": "le PBX innovaphone est installé",
        "show": "Afficher",
        "info0_network": "Configuration réseau	\r\n<p><p>\r\nSi votre appareil reçoit le bail (lease) du serveur DHCP, toutes options configuration provenant de ce bail apparaissent ici, en valeur par défaut\r\n<dl>\r\n<dt>Adresse IPv4</dt><dd>L'adresse IPv4 de la première interface (ETH0). Veuillez vous assurer que l'adresse que vous spécifiez n'est pas encore utilisée dans votre réseau. \r\n<p><p>\r\nSi vous laissez le champ <q>adresse</q> vide, le PBX recevra son adresse IP ainsi que d'autres options via DHCP. Dans ce cas, assurez-vous qu'une <q>réservation</q> a été effectuée pour l'appareil dans votre serveur DHCP. Il est important que l'adresse ne change pas dans le temps. L'adresse Mac du PBX est le <q>Numéro de série</q> imprimé sur l'appareil. \r\n</dd>\r\n<dt>Masque IPv4 </dt><dd> Le masque de sous réseau de l'interface ETH0 \r\n(p.ex. <code>255.255.255.0</code>)</dd>\r\n<dt>Routeur par défaut</dt><dd>Votre routeur par défaut de votre réseau. Le trafic IP pour des destinations inconnues du PBX y sera envoyé. </dd>\r\n<dt>Adresse du serveur DNS</dt><dd>Votre serveur de résolution de noms de domaine de votre réseau. Le PBX traduit les noms des services et hôtes (p.ex. votre opérateur SIP) sur le serveur DNS pour connaître leurs adresses IP respectives.</dd>\r\n<dt>Adresse du serveur NTP</dt><dd>Votre serveur de temps de votre réseau (p.ex. <code>pool.ntp.org</code>). Le PBX ne fonctionnera pas correctement sans un serveur de temps approprié. \r\n</dd>\r\n</dl>",
        "info0_update": "Mise à jour\r\n<ul>\r\nde la version du firmware à installer\r\n</ul>\r\n",
        "info0_devices": "Ajouter à l'installation existante \r\n<ul>\r\nNom du chemin d'accès si les applications ne doivent pas être installées sur cet appareil mais sur une autre App Platform (p.ex. <code>https://maCentraleTelephonique/App/</code>)\r\n</ul>",
        "info0_localap": "Installer l'App Platform localement\r\n<dl>\r\n<dt>Adresse IPv4</dt>\r\n<dd>\r\nAdresse IP de l'App Platform\r\n<p><p>Si vous laissez le champ <q>adresse</q> vide, l'App Platform recevra son adresse IP ainsi que d'autres options via DHCP. Dans ce cas, assurez-vous qu'une <q>réservation</q> a été effectuée pour l'App Platform dans votre serveur DHCP. Il est important que l'adresse ne change pas dans le temps. L'adresse Mac de l'App Platform est le <q>Numéro de série</q> imprimé sur l'appareil ou les deux premiers chiffres <code>00</code> sont remplacés par <code>02</code>\r\n</dd>\r\n</dl>\r\n<p><p>\r\nL'App Platform requiert obligatoirement une adresse IP différente.",
        "info1_appconnect": "Installation de l'App Platform\r\n<ul>\r\nL'App Platform est en cours d'installation, cela peut prendre un certain temps selon l'appareil......\r\n</ul>",
        "info2_deviceslogin": "Info connexion devices",
        "info3_pbxadmin": "Premier compte utilisateur avec droit d'administration\r\n<p>\r\nConfigurez le compte personnel du premier utilisateur qui doit avoir les droit d'admin. Cela peut être le vôtre p.ex.\r\n<dl>\r\n<dt>Nom d'utilisateur</dt>\r\n<dd>Le nom complet et unique de l'utilisateur, p.ex. votre nom et prénom.</dd>\r\n<dt>Adresse e-mail</dt>\r\n<dd>L’adresse qui peut être utilisée pour envoyer des e-mails à l'utilisateur. P.ex. vous pouvez définir votre propre e-mail\r\n</dd>\r\n<dt>Compte</dt><dd>L'identifiant. Vous pouvez ici utiliser la partie locale (ce qui est avant le symbole <q>@</q>). Pas de majuscules ou de caractères spéciaux, les lettres de a à z et chiffres de 0 à 9 sont autorisés ainsi que les caractères suivants .!#$%&'*+-/=?^_`{|}~</dd>\r\n<dt>Mot de passe</dt><dd>Mot de passe de connexion</dd>\r\n</dl>",
        "info3_pbxident": "Identification du PBX\r\n<dl><dt>\r\nNom de domaine (System Name)\r\n</dt><dd>\r\nEntrez le <q>nom de domaine</q> du client à installer. Sont autorisés les caractères a-z et 0-9 (pas de majuscules). Note: n'oubliez pas que ce domaine peut être utilisé pour construire les adresses e-mail utilisateur automatiquement\r\n</dd><dt>\r\nNom de l'emplacement du PBX (PBX Name)\r\n</dt><dd>\r\nIndique l'emplacement du PBX. P.ex. Le nom d'une ville comme <q>Paris</q> est un choix judicieux. Comme pour le <q>nom de domaine</q>, les lettres de a à z et chiffres de 0 à 9 sont autorisés.\r\n</dd>\r\n</dl>",
        "info3_pbxdns": "<dl>\r\n<dt>Noms de domaine</dt>\r\n<dd>Définir l'utilisation des DNS</dd>\r\n<dt>Utiliser les noms DNS pour accéder à myApps</dt>\r\n<dd>\r\nSi cette option n'est pas activée, seules les adresses IP sont utilisées. Pour certaines fonctions, les noms DNS sont requis. P.ex : \r\n<ul>\r\n<li>Accès à partir d'internet sans VPN à l'aide d'un Reverse Proxy</li>\r\n<li>Utilisation de certificats, qui sont automatiquement acceptés par les navigateurs web</li>\r\n</ul>\r\nPour passer plus tard à l'utilisation du DNS, vous devez remplacer les adresses IP dans les URLs des objets app, par les noms DNS respectifs.\r\n</dd>\r\n<dt>Nom de domaine de ce PBX</dt>\r\n<dd>Le nom DNS du PBX qui a été configuré. Il doit pointer vers l'adresse IP de votre PBX. Nous recommandons d'utiliser pour le nom DNS, les paramètres récupérés par défaut. Sont autorisés uniquement les caractères .(point) et -(tiret), les lettres minuscules de a à z (pas de majuscules) et les chiffres de 0 à 9.</dd>\r\n<dt>Nom de domaine de l'App Platform</dt>\r\n<dd>Le nom DNS de l'App Platform qui a été configuré. Il doit pointer vers l'adresse IP de votre App Platform. Comme pour le PBX, sont autorisés uniquement les caractères .(point) et -(tiret), les lettres minuscules de a à z (pas de majuscules) et les chiffres de 0 à 9.</dd>\r\n</dl>\r\n<p>\r\nL'installation vérifie que les noms DNS définis ont été configurés sur votre serveur DNS et pointe vers le bon appareil. S'ils ne sont pas encore configurés dans votre serveur DNS, vous pouvez quand même continuer, dans un mode temporaire sans DNS. Dès que les noms DNS sont définis dans votre infrastructure, vous devez décocher la case \"Operation without DNS\" (Advanced UI : PBX/Config/General).\r\n</p>",
        "info3_pbxvoicemail": "Utilisez les cases à cocher pour sélectionner les langues dont vous avez besoin pour votre boîte vocale. N'installez que les langues requises par le client.",
        "info4_showpwd": "Vous n'aurez besoin de ces mots de passe qu'en cas d'urgence. Veillez à bien les sauvegarder et les conserver précieusement.",
        "info5_installing": "Certaines applications importantes sont en train d'être installées automatiquement - ce processus peut durer quelques minutes.",
