        "info6_certificates": "Pour terminer l'installation, vous devez approuver les certificats du PBX et de l'App Platform dans votre navigateur.\r\n<br>\r\nPlusieurs fenêtres popup s'ouvriront. Confirmez le certificat dans la popup pour continuer.",
        "twofactorauth": "Authentification à deux facteurs",
        "info7_twofactorauth": "Authentification à deux facteurs\r\n<dd>\r\n<q>L'authentification à deux facteurs</q> est une méthode pour améliorer le niveau de sécurité du PBX. Chaque connexion utilisateur sera vérifiée selon deux facteurs indépendants. Par exemple, l'utilisateur se connecte à l'aide de son mot de passe et devra aussi confirmer la connexion en validant celle-ci via un email envoyé à son adresse, ou si celui-ci est connecté sur un nouvel appareil, il devra approuver la connexion. Nous recommandons toujours d'activer l'authentification à deux facteurs\r\n</dd>",
