        "info8_email": "Compte de messagerie\r\n<p>\r\nConfigurez le compte qui sera utilisé par le PBX pour vous envoyer des e-mails\r\n<dl>\r\n<dt>Serveur SMTP</dt>\r\n<dd>Nom de domaine ou adresse IP de votre serveur de messagerie (<q>Serveur-SMTP</q>)</dd>\r\n<dt>Adresse e-mail</dt>\r\n<dd>Adresse de l'expéditeur qui sera affiché dans le champ <q>De :</q> de l'e-mail. Vous pouvez utiliser votre propre adresse</dd>\r\n<dt>Compte e-mail</dt>\r\n<dd>Le nom de compte de l'utilisateur</dd>\r\n<dt>Mot de passe compte e-mail</dt>\r\n<dd>Le mot de passe de l'utilisateur</dd>\r\n<dt>Nom de l'expéditeur</dt>\r\n<dd>Un nom arbitraire qui sera utilisé comme nom d'expéditeur</dd>\r\n<dt>Nom de domaine du client</dt>\r\n<dd>Le nom de domaine du client myApps</dd>\r\n</dl>\r\nEnvoyer un e-mail de test\r\n<p>\r\nPour vérifier votre configuration, vous envoyez un e-mail de test\r\n<dl>\r\n<dt>Adresse e-mail du destinataire</dt>\r\n<dd>Adresse ou sera envoyé l'e-mail de test</dd>\r\n</dl>",
