        "show": "Anzeigen",
        "info0_network": "Netzwerk Einstellungen\r\n<p><p>\r\nFalls Ihr Gerät Informationen von Ihrem DHCP Server bekommen hat, werden diese hier als Vorbelegung angezeigt.\r\n<dl>\r\n<dt>IPv4 Adresse</dt><dd> IPv4 Adresse der ETH0 Schnittstelle. Bitte beachten dass die neue Adresse im Netzwerk nicht bereits vergeben ist. Dieses Gerät ist anschließend unter dieser Adresse erreichbar. Diese Anzeige wird automatisch auf diese neue Adresse umgeschaltet.\r\n<p><p>\r\nWenn du die Adresse leer lässt, wird die PBX ihre IP Adresse und ggf. weitere Optionen mit DHCP beziehen.  Bitte stelle dann sicher, dass in deinem DHCP Server eine <q>Reservierung</q> für die PBX angelegt wurde, denn die Adresse darf sich nicht ändern. Die Mac Adresse der App Platform ist die auf dem Gerät aufgedruckte \"Serial number\". </dd>\r\n<dt>IPv4 Netzmaske</dt><dd> Subnetzmaske der ETH0 Schnittstelle \r\n(z.B. <code>255.255.255.0</code>)</dd>\r\n<dt>Standard Router</dt><dd>Der PBX unbekannte Ziele werden zu dieser Adresse gesendet.</dd>\r\n<dt>DNS Server Adresse</dt><dd>Der DNS Server dient zur Namensauflösung. Die PBX sendet alle Namen z.B. von Diensten oder Namen von SIP Provider an den DNS Server welcher daraus eine IP-Adresse bildet. </dt>\r\n<dt>NTP Server Adresse</dt><dd>Adresse des Zeitservers (Network Time Protocol, z.B. <code>pool.ntp.org</code>). Ein korrekter Betrieb der PBX ohne Datum und Zeit ist nicht möglich\r\n</dd>\r\n</dl>\r\n\r\n",
        "info0_update": "Update\r\n<ul>\r\nzu installierende Firmwareversion\r\n</ul>\r\n",
        "info0_devices": "Zu existierender Installation hinzufügen\r\n<ul>\r\nPfadname wenn die Applikationen nicht auf diesem Gerät sondern auf einer anderen App Platform installiert werden soll (z.B. <code>https://meineZentralePBX/App/</code>\r\n</ul>",
        "info0_localap": "Lokale App Platform installieren\r\n<dl>\r\n<dt>IPv4 Adresse</dt>\r\n<dd>\r\nAdresse unter welcher die App Platform auf diesem Gerät erreichbar sein soll.\r\n<p><p>Wenn du die Adresse leer lässt, wird die App Platform ihre IP Adresse und ggf. weitere Optionen mit DHCP beziehen. Bitte stelle dann sicher, dass in deinem DHCP Server eine <q>Reservierung</q> für die App Platform angelegt wurde, denn die Adresse darf sich nicht ändern.  Die Mac Adresse der App Platform ist die auf dem Gerät aufgedruckte <q>Serial number<q>, nur dass die ersten zwei Ziffern <code>02</code> statt <code>00</code> lauten müssen. \r\n</dd>\r\n</dl>\r\n<p><p>\r\nDie App Platform benötigt immer eine eigene IP Adresse.",
        "info0_myappsstart": "Gib hier den Aktivierungskey für dein myApps Start Produkt ein",
        "info1_appconnect": "App Platform setup\r\n<ul>\r\nDie App Platform wird installiert, dies kann je nach Gerät einige Zeit dauern...\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "Erstes Benutzerkonto mit Administrationsrechten\r\n<p>\r\nRichte hier das persönliche Konto für den Benutzer ein, der Administratorrechte haben soll.  Das kannst z.B. Du selbst sein. \r\n<dl>\r\n<dt>Anzeige Name</dt>\r\n<dd>Der vollständige und eindeutige Name des Benutzers, z.B. dein Vor- und Zuname.</dd>\r\n<dt>E-Mail Adresse</dt>\r\n<dd>Die E-Mail Adresse über die dem Benutzer eine E-Mail gesendet werden kann. Trage also z.B. deine eigene E-Mail Adresse ein. \r\n<dt>Konto</dt><dd>Der Login-Name. Hier kannst du z.B. den <q>local part</q> deiner Email-Adresse verwenden (also den Teil vor dem <q>@</q>, keine Sonderzeichen, keine Großbuchstaben, erlaubt sind hier a-z, 0-9 sowie die Zeichen .!#$%&'*+-/=?^_`{|}~</dd>\r\n<dt>Passwort</dt><dd>Passwort für das Login.</dd>\r\n</dl>",
        "info3_pbxident": "Identifikation der PBX\r\n<dl><dt>\r\nDomain Name\r\n</dt><dd>\r\nHier wird der <q>Domain Name</q> des Kunden eingetragen.  Hier sind die Zeichen a-z, 0-9.- erlaubt (keine Großbuchstaben)\r\n</dd><dt>\r\nPBX Standort Name\r\n</dt><dd>\r\nBezeichnet den Standort dieser PBX.  Hier ist z.B. ein Ortsname wie <q>berlin</q> sinnvoll.  Ebenso wie beim <q>Domain Name</q> sind hier die Zeichen a-z, 0-9.- erlaubt \r\n</dd>\r\n</dl>",
        "info3_pbxdns": "<dl>\r\n<dt>Domain Names</dt>\r\n<dd>Verwendung von DNS festlegen</dd>\r\n<dt>DNS verwenden um auf myApps zuzugreifen</dt>\r\n<dd>\r\nFalls diese Option nicht gesetzt ist, werden ausschließlich IP Adressen verwendet. Für manche Funktionen ist DNS Zugriff erforderlich. Z.B.\r\n<ul>\r\n<li>Zugriff aus dem öffentlichen Internet ohne VPN über Reverse Proxy</li>\r\n<li>Verwendung von Zertifikaten, die vom Browser automatisch akzeptiert werden</li>\r\n</ul>\r\nUm nachträglich auf Verwendung von DNS zu wechseln, müssen in den URLs der App Objekte die IP Adressen durch den DNS Namen ersetzt werden.\r\n</dd>\r\n<dt>DNS Name dieser PBX</dt>\r\n<dd>Der DNS Name unter dem die IP Adresse dieser PBX im DNS Server der Infrastruktur eingetragen ist.  Am einfachsten ist es, wenn Du die Vorbelegung übernimmst.  In jedem Fall sind hier nur die Zeichen a-z, 0-9, . und - erlaubt (keine Großbuchstaben)</dd>\r\n<dt>DNS Name dieser App Platform</dt>\r\n<dd>Der DNS Name unter dem die IP Adresse dieser App Platform im DNS Server der Infrastruktur eingetragen ist. Wie bei der PBX sind hier nur die Zeichen a-z, 0-9, . und - erlaubt</dd>\r\n</dl>\r\n<p>\r\nInstall prüft, ob diese Namen im DNS gefunden werden und auf das Gerät zeigen, das du gerade konfigurierst. Wenn diese Prüfung fehlschlägt, weil z.B. die DNS Einträge noch nicht vorhanden sind, kannst du trotzdem fortfahren, in einem temporären Modus ohne DNS. Sobald die DNS Einträge vorhanden sind sollte das \"Operation without DNS\" checkmark (Advanced UI: PBX/Config/General), gelöscht werden.\r\n</p>",
        "info3_pbxvoicemail": "Wähle mit den Kontrollkästen aus welche Sprachen für die Sprachbox benötigt werden. Installiere nur die für den Kunden tatsächlich erforderlichen Sprachen.",
        "info4_showpwd": "Diese Passwörter sind komplexe, zufällig ausgewürfelte Ausdrücke und nur für den Notfall gedacht. Bitte speichere sie an einem sicheren Ort! (Markiere und speichere sie z.B. in einem Texteditor.) Die Administration des Gerätes und der PBX erfolgt über ein reguläres Benutzerkonto mit Administrationsberechtigung.",
        "info5_installing": "Einige wichtige Apps werden nun automatisch installiert - dieser Vorgang kann einige Minuten dauern.",
