        "info7_twofactorauth": "Zwei-Faktor-Authentifizierung\r\n<dd>\r\nMit der <q>Zwei-Faktor-Authentifizierung</q> wird die Sicherheit der PBX verbessert, in dem beim Login eines Nutzers mittels der Kombination zwei unterschiedliche Komponenten (Faktoren) geprüft werden.  Das kann z.B. das Kennwort zusammen mit einer zu bestätigenden E-Mail sein. Wir empfehlen grundsätzlich, die Zwei-Faktor-Authentifizierung zu aktivieren!\r\n</dd>",
