        "show": "Visualizza",
        "info0_network": "Impostazioni di rete\r\n<p><p>\r\nSe il tuo apparato riceve dei parametri dal tuo DHCP Server questi vengono proposti qui come valori di default.\r\n\r\n<dl>\r\n<dt>Indirizzo IPv4</dt><dd> Indirizzo IPv4 dell'interfaccia ETH0. Si prega di assicurarsi che l'indirizzo ip inserito non sia già utilizzato nella propria rete. L'apparato sarà in seguito raggiungibile a questo indirizzo. Questa pagina si aggiornerà automaticamente utilizzando il nuovo indirizzo.\r\n<p><p>\r\nSe questo campo è lasciato vuoto il PBX richiederà l’indirizzo e altri parametri al tuo DHCP Server. Assicurati che ci sia una <q>assegnazione statica</q> per il PBX affinché l'indirizzo non cambi. L’indirizzo Mac del PBX è stampato sull’apparato sotto \"Serial number\". \r\n\r\n</dd>\r\n<dt>IPv4 Subnet Mask</dt><dd>Subnet Mask dell'interfaccia ETH0<br>\r\n<pre>(es. 255.255.255.0)</pre></dd>\r\n<dt>Router principale</dt><dd>Default gateway a cui vengono inoltrate le richieste verso destinazioni ip sconosciute al PBX.</dd>\r\n<dt>Indirizzo server DNS</dt><dd>Il server DNS  effettua la risoluzione di nomi in indirizzi ip. Il PBX invia tutti i nomi (di servizi o provider SIP) al server DNS il quale si occuperà restituire un indirizzo IP al PBX. </dt>\r\n<dt>Indirizzo server NTP </dt><dd>Indirizzo del server che fornisce data e ora (Network Time Protocol) al PBX. Un funzionamento senza data e ora non consente l'utilizzo di importanti servizi ed applicazioni, si raccomanda quindi di utilizzare sempre un server NTP.<br>\r\n<pre>(es. pool.ntp.org)</pre> </dd>\r\n</dl>\r\n",
        "info0_update": "Aggiornamento\r\n<ul>\r\n<li>Versione del firmware da installare</li>\r\n</ul>\r\n",
        "info0_devices": "Aggiungi a installazione esistente\r\n<ul>\r\nURL da configurare se non intendi installare l'applicazione su questo apparato, ma su un'App Platform differente.\r\n<pre>(es. https://myCompanyPBX/App/) </pre> \r\n</ul>",
        "info0_localap": "Installa App Platform localmente\r\n<dl>\r\n<dt>Indirizzo IPv4</dt>\r\n<dd>\r\nIndirizzo attraverso il quale sarà possibile raggiungere la App Platform installata su questo apparato.\r\n<p><p>Se lasci libero questo campo la App Platform otterrà il proprio indirizzo e eventualmente ulteriori parametri via DHCP. Assicurati in questo caso che nel tuo DHCP server esista una <q>assegnazione statica</q> per la App Platform, affinché l'indirizzo non cambi. Il MAC address della App Platform è il \"Serial number\" stampato sull'apparato, con le prime due cifre <code>00</code> sostituite da <code>02</code>. \r\n</dd>\r\n</dl>\r\n<p><p>\r\nLa App Platform richiede sempre un proprio indirizzo IP.\r\n",
        "info1_appconnect": "App Platform setup\r\n<ul>\r\nL'App Plattform è in fase di installazione, questa procedura potrebbe richiedere, a seconda del dispositivo, del tempo....\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "Primo account utente con diritti di amministrazione\r\n<p>\r\nConfigura qui l'account per l’utente che avrà diritti di amministratore, per esempio te stesso. \r\n<dl>\r\n<dt>Nome utente</dt>\r\n<dd>Nome completo ed univoco dell'utente, per esempio il tuo nome e cognome.</dd>\r\n<dt>Indirizzo mail</dt>\r\n<dd>Indirizzo mail da usare per invare una mail all'utente. Per esempio il tuo indirizzo mail.\r\n<dt>Account Utente</dt><dd>Nome Utente per il Login. Qui puoi impostare per esempio la <q>parte utente</q> del tuo indirizzo mail (quindi la parte prima del <q>@</q>, no caratteri speciali, no lettere maiuscole, sono ammessi a-z, 0-9 e i caratteri .!#$%&'*+-/=?^_`{|}~</dd>\r\n<dt>Password</dt><dd>Password per il login.</dd>\r\n</dl>\r\n",
        "info3_pbxident": "Identificazione del PBX\r\n<dl><dt>\r\nDomain Name\r\n</dt><dd>\r\nQui viene impostato il  <q>Domain Name</q> del cliente.  Qui sono ammessi i caratteri da a-z, 0-9 e il carattere . (no caratteri maiuscoli)\r\n</dd><dt>\r\nNome del PBX \r\n</dt><dd>\r\nIndica il nome (la sede) di questo PBX.  Consigliamo di mettere nomi di città o località come per esempio <q>Verona</q>.  Come nel <q>Domain Name</q> qui sono ammessi i caratteri a-z, 0-9.- \r\n</dd>\r\n</dl>\r\n",
        "info3_pbxdns": "<dl>\r\n<dt>Nomi DNS</dt>\r\n<dd>Definire l'uso del DNS</dd>\r\n<dt>Usa il nome DNS per accedere a myApps</dt>\r\n<dd>\r\nSe questa opzione non è impostata, saranno utilizzati solamente indirizzi IP. Per alcune funzioni i nomi DNS sono necessari. Per esempio:\r\n<ul>\r\n<li>Accesso da internet senza VPN attraverso un Reverse Proxy</li>\r\n<li>Utilizzo di certificati che vengano accettati automaticamente dal browser</li>\r\n</ul>\r\nPer passare all'utilizzo dei nomi DNS dopo l'installazione, sarà necessario sostituire gli indirizzi IP degli URL negli oggetti App con i rispettivi nomi DNS.\r\n</dd>\r\n<dt>Nome DNS di questo PBX</dt>\r\n<dd>Il nome DNS che è stato assegnato/associato a questo PBX. Deve essere risolto con l'indirzzo ip del vostro PBX. Consigliamo di mantenere i nomi DNS suggeriti di default. Questi campi ammettono solo i caratteri a-z, 0-9, . e - (no maiuscole).</dd></dd>\r\n<dt>Nome DNS dell' App Platform</dt>\r\n<dd>Il nome DNS che è stato assegnato/associato all' app platform. Deve essere risolto con l'indirzzo ip dell'app platform. Come per il PBX, Questi campi ammettono solo i caratteri a-z, 0-9, . e - (no maiuscole).</dd>\r\n</dl>\r\n<p>\r\nL'install verifica che i nomi DNS configurati vengano risolti dal vostro server DNS e puntino ai dispositivi desiderati. Se questi nomi non sono ancora configurati sul vostro server DNS è comunque possibile proseguire in modalità provvisoria senza DNS. Appena i nomi DNS saranno configurati sul server DNS vi preghiamo di disabilitare l'opzione  \"Operation without DNS\" (Advanced UI: PBX/Config/General).\r\n</p>",
        "info3_pbxvoicemail": "Seleziona in quali lingue vuoi utilizzare per le caselle vocali. Si consiglia di installare solo le lingue effettivamente richieste/utilizzate dal cliente.",
        "info4_showpwd": "Seleziona e copia le password (es. in un editor di testo) e salva il file in una destinazione sicura. Queste password sono pensate solo per situazioni di emergenza. L'accesso ordinario avviene con le credenziali di amministratore.\r\nLa prima password serve ad accedere via web ai devices una volta effettuato il provisioning.\r\nLa seconda password è la password PBX.\r\n",
        "info5_installing": "Alcune App principali vengono installate automaticamente - questo processo può richiedere qualche minuto.",
