        "show": "Pokaż",
        "info0_network": "Ustawienia sieci \r\n<p><p>\r\nJeżeli urządzenie otrzymało informacje z serwera DHCP, są one tutaj wyświetlane jako domyślne.\r\n<dl>\r\n<dt>Adres IPv4</dt><dd>Adres IPv4 Interfejsu ETH0. Upewnij się, że podany przez Ciebie adres nie jest już używany w Twojej sieci.  Urządzenie to będzie wtedy dostępne pod tym adresem. Informacja ta jest automatycznie przełączana na nowy adres.\r\n<p><p>\r\nJeżeli pozostawisz pole adres puste, centrala otrzyma swój adres IP i wszelkie inne opcje z DHCP.  Upewnij się, że w Twoim serwerze DHCP została skonfigurowana <q>Rezerwacja</q> dla PBX, ponieważ adres nie może ulec zmianie. Adres Mac App Platform to \"Serial number\" wydrukowany na urządzeniu. </dd>\r\n<dt>Maska sieci IPv4</dt><dd> Maska podsieci interfejsu ETH0 \r\n(np. <code>255.255.255.0</code>)</dd>\r\n<dt>Standard Router</dt><dd>Na ten adres wysyłany jest ruch IP nieznany centrali.</dd>\r\n<dt>DNS Server Adresse</dt><dd>Der DNS Server dient zur Namensauflösung. Die PBX sendet alle Namen z.B. von Diensten oder Namen von SIP Provider an den DNS Server welcher daraus eine IP-Adresse bildet. </dt>\r\n<dt>NTP Server Adresse</dt><dd>Adresse des Zeitservers (Network Time Protocol, z.B. <code>pool.ntp.org</code>). Ein korrekter Betrieb der PBX ohne Datum und Zeit ist nicht möglich\r\n</dd>\r\n</dl>\r\n\r\n",
        "info0_update": "Aktualizacja\r\n<ul>\r\nwersja oprogramowania do zainstalowania\r\n</ul>\r\n",
        "info0_devices": "Dodaj do istniejącej instalacji\r\n<ul>\r\nNazwa ścieżki, jeśli aplikacje nie mają być instalowane na tym urządzeniu, ale na innej App Platform (np. <code>https://meineZentralePBX/App/</code>\r\n</ul>",
        "info0_localap": "Instalacja lokalnej App Platform\r\n<dl>\r\n<dt>Adres IPv4</dt>\r\n<dd>\r\nAdres, pod którym App Platform powinna być dostępna na tym urządzeniu.\r\n<p><p>Jeśli pozostawisz pole adresu puste, platforma App Platform otrzyma swój adres IP i ewentualnie dalsze ustawienia konfiguracyjne poprzez DHCP. W tym przypadku upewnij się, że utworzona została <q>rezerwacja</q> dla App Platform w Twoim serwerze DHCP Server, ponieważ adres nie może ulec zmianie. Adres Mac App Platform to <q>Numer seryjny<q> umieszczony na urządzeniu z pierwszymi dwiema cyframi <code>02</code> zamiast <code>00</code>. \r\n</dd>\r\n</dl>\r\n<p><p>\r\nApp Platform zawsze wymaga własnego adresu IP.",
        "info1_appconnect": "App Platform jest aktywna\r\n<ul>\r\nApp Platform jest w fazie instalacji. W zależności od urządzenia proces ten może zająć trochę czasu.\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "Pierwsze konto użytkownika z uprawnieniami administratora\r\n<p>\r\nZałóż konto dla pierwszego użytkownika, który będzie miał prawa administratora, np. możesz to być również Ty. \r\n<dl>\r\n<dt>Nazwa użytkownika</dt>\r\n<dd>Pełna nazwa użytkownika, np. imię i nazwisko.</dd>\r\n<dt>Adres e-mail</dt>\r\n<dd>Adres, który może być użyty do wysyłania wiadomości e-mail do użytkownika, np. Twój adres e-mail.\r\n<dt>Konto</dt><dd>Login. Tutaj możesz użyć np. <q>lokalnej części</q> Twojego adresu e-mail (która znajduje się przed <q>@</q>, bez znaków specjalnych oraz dużych liter. Dozwolone są znaki a-z, 0-9 oraz znaki szczególne takie jak .!#$%&'*+-/=?^_`{|}~</dd>\r\n<dt>Hasło</dt><dd>Hasło do logowania</dd>\r\n</dl>\r\n\r\n",
        "info3_pbxident": "Identyfikacja PBX\r\n<dl><dt>\r\nNazwa domeny\r\n</dt><dd>\r\nWpisz tutaj <q>Nazwa domeny</q> klienta. Dozwolone są tylko znaki a-z, 0-9, . oraz - (bez wielkich liter)\r\n</dd><dt>\r\nPBX Oddział Nazwa\r\n</dt><dd>\r\nOkreśla lokalizację centrali. Sensowne jest podanie nazwy miejscowości np. <q>berlin</q>.  Podobnie jak w przypadku <q>Nazwa domeny</q> dozwolone są tylko znaki a-z, 0-9, . oraz -\r\n</dd>\r\n</dl>",
        "info3_pbxdns": "<dl>\r\n<dt>Nazwy domen</dt>\r\n<dd>Zdefiniowanie użycia DNS</dd>\r\n<dt>Użyj DNS, aby uzyskać dostęp do myApps</dt>\r\n<dd>\r\nJeśli ta opcja nie jest ustawiona, używane są tylko adresy IP. Dla niektórych funkcji wymagany jest dostęp do DNS, np.\r\n<ul>\r\n<li>Dostęp z publicznego Internetu bez VPN przez Reverse Proxy</li>\r\n<li>Użycie certyfikatów, które są automatycznie akceptowane przez przeglądarkę</li>\r\n</ul>\r\nAby następnie przejść do korzystania z DNS, adresy IP w adresach URL obiektów aplikacji muszą być zastąpione przez nazwę DNS.\r\n</dd>\r\n<dt>Nazwa DNS tej centrali PBX</dt>\r\n<dd>Nazwa DNS, pod którą adres IP centrali jest wprowadzany do serwera DNS infrastruktury. Najprostszym sposobem jest przejęcie ustawień domyślnych. Dozwolone są tutaj tylko znaki a-z, 0-9, . oraz - (bez wielkich liter)</dd>\r\n</dd>\r\n<dt>Nazwa DNS tej App Platform</dt>\r\n<dd>Nazwa DNS, pod którą w serwerze DNS infrastruktury wpisywany jest adres IP tej App Platform. Podobnie jak w centrali PBX, tylko znaki a-z, 0-9, . i - są tutaj dozwolone</dd>.\r\n</dl>\r\n<p>\r\nInstall sprawdza, czy te nazwy znajdują się w DNS i wskazują na urządzenie, które jest aktualnie konfigurowane. Jeśli to sprawdzenie nie powiedzie się, np. ponieważ wpisy DNS nie są jeszcze obecne, można kontynuować w trybie tymczasowym bez DNS. Gdy tylko wpisy DNS będą dostępne, należy usunąć znacznik wyboru \"Operation without DNS\" (Advanced UI: PBX/Config/General).\r\n</p>\r\n\r\n",
        "info3_pbxvoicemail": "Wybierz wszystkie języki, które ma obsługiwać Twój system poczty głosowej.   Instaluj tylko te języki, które są rzeczywiście używane przez klienta.",
        "info4_showpwd": "Wybierz i skopiuj hasła (np. w edytorze tekstu) i przechowuj je w bezpiecznym miejscu. Hasła te są przeznaczone wyłącznie do celów awaryjnych i dlatego są losowo kodowane jako złożone wyrażenia. Normalny dostęp administratora odbywa się za pośrednictwem uprawnień administratora.",
