        "show": "Mostrar",
        "info0_network": "Configurações de rede\r\n<p><p>\r\nSe o seu dispositivo recebeu um lease de um servidor DHCP, todas as opções de configuração incluídas nesse lease serão visualizadas aqui como valores padrão.\r\n<dl>\r\n<dt>Endereço IPv4</dt><dd>O endereço IPv4 da primeira interface (ETH0). Por favor, verifique se o endereço especificado ainda não está em uso na sua rede.\r\n<p><p>\r\nSe você deixar o campo de endereço vazio, o PBX receberá seu endereço IP, e possivelmente outras opções, através de DHCP. Nesse caso, certifique-se de que foi feita uma <q>reserva</q> pelo dispositivo em seu servidor DHCP. Isso é importante porque o endereço não deve mudar com o tempo. O endereço MAC do PBX é o <q>número de série</q>, também impresso no dispositivo.\r\n</dd>\r\n<dt>Máscara de Rede IPv4</dt><dd> A máscara de sub-rede da interface ETH0 (p.ex. <code>255.255.255.0</code>)</dd>\r\n<dt>Roteador padrão</dt><dd>Seu gateway padrão. Tráfego IP para destinos desconhecidos para o PBX será enviado para este endereço.</dd>\r\n<dt>Endereço do servidor DNS</dt><dd>O servidor de resolução de nome de domínio da sua rede. O PBX envia todos os nomes de serviços ou hosts (p.ex. do provedor SIP) para o servidor DNS para aprender desta forma seus respectivos endereços IP.</dd>\r\n<dt>Endereço de servidor NTP</dt><dd>O servidor de horário da sua rede (p.ex. <code>pool.ntp.org</code>). O PBX não opera corretamente sem um servidor de horário apropriado.\r\n</dd>\r\n</dl>",
        "info0_update": "Atualização\r\n<ul>\r\nVersão do firmware a ser instalado\r\n</ul>",
        "info0_devices": "Adicionar à instalação existente\r\n<ul>\r\nNome do caminho se você não pretende instalar os aplicativos neste dispositivo, mas em outra App Platform (p. ex. <code>https://meuPBXcentral/App/</code>\r\n</ul>",
        "info0_localap": "Instalar a App Platform local\r\n<dl>\r\n<dt>Endereço IPv4</dt>\r\n<dd>\r\nEndereço IP da nova App Platform.\r\n<p><p>Se você deixar o campo de endereço vazio, a App Platform obterá seu endereço IP e, possivelmente, configurações adicionais via DHCP. Neste caso, certifique-se de que uma <q>reserva</ q> para o endereço IP da App Platform foi criada em seu servidor DHCP. Isso é importante, porque o endereço não deve mudar com o tempo. O endereço MAC da App Platform é o <q>número de série</q> impresso na parte inferior do dispositivo, com os dois primeiros dígitos <code>00</code> substituído por <code>02</code>.\r\n</dd>\r\n</dl>\r\n<p><p>\r\nA App Platform requer sempre seu endereço IP próprio.",
