        "info3_pbxadmin": "Primeira conta de usuário com direitos administrativos\r\n<p>\r\nConfigure aqui a conta para o usuário que terá direitos de administrador, por exemplo você. \r\n<dl>\r\n<dt>Nome de usuário</dt>\r\n<dd>O nome completo e exclusivo do usuário, p.ex., seu nome e sobrenome.</dd>\r\n<dt>Endereço de e-mail</dt>\r\n<dd>Endereço de e-mail a ser usado para enviar um e-mail ao usuário. Por exemplo, seu endereço de e-mail.\r\n<dt>Conta do usuário</dt><dd>Nome do usuário para login. Aqui você pode definir, por exemplo, a<q>parte do usuário</q>do seu endereço de e-mail (portanto, tudo que antecede os símbolos <q>@</q>)Não são permitidos caracteres especiais nem letras maiúsculas, somente as letras de \"a\" até \"z\", números de 0 a 9 e os caracteres.!#$%&'*+-/=?^_`{|}~</dd>\r\n<dt>Senha</dt><dd>Senha para login.</dd>\r\n</dl>",
        "info3_pbxident": "Identificação do PBX\r\n<dl><dt>\r\nNome de domínio\r\n</dt><dd>\r\nDigite o <q>nome de domínio</q> do cliente. Letras maiúsculas e caracteres especiais não são permitidos, apenas pode-se usar as letras de ‘a até z’, os números de ‘0 até 9’ e o caractere ‘-’.\r\n</dd><dt>\r\nNome da localização do PBX\r\n</dt><dd>\r\nIndique a localização do PBX. P.ex. o nome de cidade como  <q>florianopolis</ q>. Como acima, letras maiúsculas e caracteres especiais não são permitidos, apenas pode-se usar as letras de ‘a até z’, os números de ‘0 até 9’ e o caractere ‘-’.\r\n</dd>\r\n</dl>",
        "info3_pbxdns": "dl>\r\n<dt>Nomes de domínio</dt>\r\n<dd>Defina o uso de DNS</dd>\r\n<dt>Use DNS para acessar myApps</dt>\r\n<dd>\r\nSe esta opção não for ativada, apenas endereços IP serão usados. Para algumas funções, serão necessários nomes DNS. P.ex.:\r\n<ul>\r\n<li>Acesso da Internet sem VPN usando um Reverse Proxy</li>\r\n<li>Uso de certificados, que são aceitos automaticamente pelos navegadores</li>\r\n</ul>\r\nPara alterar para o uso de DNS após a instalação, você precisa substituir os endereços IP nos URLs dos objetos do app pelos seus respectivos nomes DNS.\r\n</dd>\r\n<dt>Nome DNS deste PBX</dt>\r\n<dd>O nome DNS que foi configurado para o PBX. Deve apontar para o endereço IP do seu PBX. Recomendamos usar as configurações padrão para o nome DNS. Apenas os caracteres. (Ponto) e - (hífen), letras minúsculas de a até z (sem letras maiúsculas) e números de 0 a 9.</dd>\r\n<dt>Nome DNS da App Platform</dt>\r\n<dd>O nome DNS que foi configurado para a App Platform. Deve apontar para o endereço IP da sua App Platform.  Assim como no PABX, esses campos admitem apenas as letras de \"a\" até \"z\", os números 0-9 e os caracteres \".\" e \"-\" (sem letras maiúsculas). </dd>\r\n</dl>\r\n<p>\r\nA instalação verifica se os nomes DNS definidos foram configurados no servidor DNS e apontam para o dispositivo correto. Se eles ainda não foram configurados em seu DNS, você ainda pode continuar, em um modo temporário sem DNS. Assim que os nomes DNS forem definidos em sua infraestrutura, você deve desmarcar a caixa \"Operação sem DNS\" (IU avançada: PBX/Config/General).\r\n</p>",
        "info3_pbxvoicemail": "Selecione quais idiomas você deseja usar para o correio de voz. Recomendamos instalar apenas os idiomas realmente utilizados pelo cliente.",
        "info4_showpwd": "Selecione e copie as senhas (p.ex., em um editor de texto) e armazene-as em um local seguro. Essas senhas serão utilizadas apenas em casos de emergência e, portanto, são expressões complexas, codificadas aleatoriamente. O acesso regular do administrador acontece por meio de credenciais de administrador.",
        "info5_installing": "Alguns aplicativos importantes estão sendo instalados automaticamente. Isso poderá demorar alguns instantes.",
