        "info8_email": "E-mail аккаунт\r\n<p></p>\r\nНастройте учетную запись почты, которую будет использовать АТС для отправки электронных сообщений.\r\n<dl>\r\n<dt>Сервер SMTP</dt>\r\n<dd>Имя хоста или IP-адрес Вашего почтового сервера исходящей почты.</dd>\r\n<br>\r\n<dt>Адрес электронной почты</dt>\r\n<dd>Адрес отправителя, который будет использоваться в таких сообщениях. Как вариант, Вы можете использовать свой адрес электронной почты.</dd>\r\n<br>\r\n<dt>Имя пользователя</dt>\r\n<dd>Имя пользователя почтового аккаунта.</dd>\r\n<br>\r\n<dt>Пароль аккаунта</dt>\r\n<dd>Пароль почтового аккаунта.</dd>\r\n<br>\r\n<dt>Отправитель</dt>\r\n<dd>Произвольное имя, которое будет использоваться в качестве имени отправителя.</dd>\r\n</dl>\r\nТест отправки сообщений\r\n<p></p>\r\nЧтобы проверить параметры настройки, Вы можете отправить тестовое сообщение.\r\n<dl>\r\n<dt>Получатель</dt>\r\n<dd>Адрес электронной почты, на который следует отправить тестовое письмо.</dd>\r\n</dl>",
