        "info_extap0": "<dl>\r\n    <dt>Существующая платформа приложений (AppPlatform)</dt>\r\n    <dd>Предполагается, что платформа приложений, которая должна использоваться совместно с этой АТС, уже установлена ​​на шлюзе или виртуальной машине.</dd>\r\n    <dd>Для режима «Только обновление и сетевые настройки» можно использовать кнопку поиска шлюза, подготовленного для установки платформы приложений. В других режимах необходимо ввести IP-адрес платформы приложений явным образом.</dd>\r\n</dl>\r\n\r\n",
