        "info0_network": "Nastavitve omrežja\r\n<p><p>\r\nČe je vaša naprava prejela informacije od vašega strežnika DHCP, se bo tukaj prikazala kot privzeta.\r\n<Dl>\r\n<dt> Naslov IPv4 </dt> <dd> Naslov IPv4 vmesnika ETH0. Upoštevajte, da novi naslov v omrežju še ni sprejet. Ta naprava je od zdaj naprej dosegljiva na tem naslovu. Ta zaslon se samodejno preklopi na ta novi naslov.\r\n<P> <p>\r\nČe pustite naslovno vrstico prazno, bo PBX dobil svoj IP naslov in vse druge možnosti preko DHCP strežnika. V tem primeru se prepričajte, da je bila za napravo na DHCP strežniku ustvarjena <q>rezervacija</q>, ker se naslov ne sme spremeniti. Mac naslov aplikacije je \"serijska številka\", natisnjena na napravi. </Dd>\r\n<dt> IPv4 netmask </dt> <dd> Maska omrežja vmesnika ETH0\r\n(npr. <code> 255.255.255.0 </code>) </dd>\r\n<dt> Privzeti usmerjevalnik </dt> <dd> Vaš privzeti prehod. Na ta naslov se pošlja IP promet, ki nima definiranega cilja. </dd>\r\n<dt> Naslov strežnika DNS </dt> <dd> DNS strežnik se uporablja za pretvorbo imenskih zapisov v IP obliko. PBX pošlje vsa imena, npr. storitev ali imena ponudnikov SIP na strežnik DNS, ki tvori naslov IP. </Dt>\r\n<dt> Naslov strežnika NTP </dt> <dd> Naslov časovnega strežnika (npr. <code> pool.ntp.org </code>). Pravilno delovanje PBX brez datuma in časa ni mogoče.\r\n</Dd>\r\n</Dl>",
        "info0_update": "Posodobitev\r\n<ul>\r\nprosim izberite verzijo na katero želite posodobiti vašo napravo\r\n</ul>",
        "info0_devices": "Dodaj k obstoječi namestitvi\r\n<ul>\r\nPot do aplikacije, v primeru da Aplikacija ne bo nameščena na tej napravi ampak na neki zuanji App Platformi <code>https://mojaPBX/App/</code>\r\n</ul>",
        "info0_localap": "Namesti lokalno App platformo\r\n<dl>\r\n<dt>IPv4 naslovi</dt>\r\n<dd>\r\nIP naslov nove app platforme.\r\n<p><p>Če pustite naslovni prostor prazen, bo App platforma dobila svoj IP in mogoče tudi druge nastavitve preko DHCPja. Prepričajte se, da je bila v tem primeru pripravljena IP <q>rezervacija</q> na vašem DHCP strežniku. To je pomembno, ker se IP naslov s časom ne sme spreminjati. Mac naslov APP platforme je Serijska številka, ki je izpisana na tej napravi s prvima dvema znakoma <code>00</code> nadomeščenima z <code>02</code>.\r\n</dd>\r\n</dl>\r\n<p><p>\r\nA platforma vedno zahteva lasten IP naslov.",
        "info1_appconnect": "App platforma nastavitve\r\n<ul>\r\nApp Platforma se namešča, kar lahko traja nekaj časa....\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "Prvi uporabniški račun z administrativnimi pravicami\r\n<p>\r\nTu ustvarite privatni račun za uporabnika, ki naj ima administrativne pravice. To si lahko npr. tudi ti.\r\n<dl>\r\n<dt>Uporabniško ime</dt>\r\n<dd>Popolno in unikatno ime uporabnika (npr. tvoj priimek).</dd>\r\n<dt>E-poštni naslov</dt>\r\n<dd>E-poštni naslo kateri se uporablja za pošiljanje mailov uporabniku (npr. tu lahko določite tudi vaš lastni e-poštni naslov).</dd>\r\n<dt>Račun</dt><dd>Uporabniško ime.. Tu lahko uporabite lokalni del vašega e-poštnega računa (vse pred <q>@</q>). Brez velikih črk ali posebnih znakov (samo črke a-z, številke od 0-9 in posebni znaki .!#$%&'*+-/=?^_`{|}~ ).</dd>\r\n<dt>Geslo</dt><dd>Geslo za prijavo.</dd>\r\n</dl>",
        "info3_pbxident": "PBX oznaka\r\n<dl><dt>\r\nDomensko ime\r\n</dt><dd>\r\nTu vnesi uporabnikovo <q>domensko ime</q> .  Dovolji so znaki od a-z, 0-9, \".\" in \"-\" (brez velikih začetnic).\r\n</dd><dt>\r\nPBX lokacija\r\n</dt><dd>\r\nOpis lokacije PBXa. Navede se lahko naziv kot <q>ljubljana</q>.  Tako kot pri domenskem imenu so tudi tu dovolji samo znaki od a-z, 0-9, \".\" in \"-\" (brez velikih začetnic).\r\n</dd>\r\n</dl>",
        "info3_pbxdns": "Domenska imena\r\n<p>\r\nDNS imena za PBX in App platformo, ki so nastavljena v vašem DNS strežniku.\r\n<p>\r\nNamestitev bo preverila, da so ta imena nastavljena v vašem DNS strežniku in da kažejo na pravo napravo (npr. IP naslov). Če še niso nastavljena v vašem DNS strežniku, jih lahko pustite prazne in nadaljujete z namestitvijo. Kljub temu predlagamo, da se jih nastavi že takoj.\r\n<dl>\r\n<dt>DNS ime za ta PBX</dt>\r\n<dd>DNS ime, ki je bilo nastavljeno za ta PBX. Kazati mora na IP naslov vaše centrale. Predlagamo, da uporabljate samo privzete vrednosti (dovoljeni znaki so samo crke od a-z, številke od 0-9, znaka \".\" in \"-\").</dd>\r\n<dt>DNS ime te App Platforme</dt>\r\n<dd>DNS naslov pod katerim je dosegljiv IP naslov te App platforme. Tako kot pri PBX so tudi tu dovoljeni znaki samo crke od a-z, številke od 0-9, znaka \".\" in \"-\".</dd>\r\n</dl>\r\nV primeru zapisa v DNS strežniku lahko pride do tega, da bo potrebno na sistemu in operacijskem sistemu pobrisati DNS predpomnilnik, da bo namestitev lahko uporabila ta nov zapis.",
        "info3_pbxvoicemail": "Izberite vse jezike, ki naj jih podpira vaš sistem glasovne pošte.",
        "info4_showpwd": "Ta gesla se običajno ne uporabljajo. So pa uporabna v izjemnih primerih (npr.  če ste pozabili geslo za uporabnike z administratorskim dostopom). Poskrbite torej, da jih varujete na varnem!",
        "info5_installing": "Nameščajo se nekateri pomembni Apps-i - to lahko traja nekaj časa...",
        "pwd_admin": "Administratorsko geslo",
