        "info6_certificates": "Za zaključek namestitve morate zaupati certifikatu PBX in certifikatu App platforme.\r\n<br>\r\nV vašem brskalniku se bo odprla dodatna okna. Potrdite uvozu certifikata za nadaljevanje.",
        "twofactorauth": "Dvo-faktorska avtentikacija",
        "info7_twofactorauth": "Dvo-faktorska avtentikacija\r\n<dd>\r\n<q>Dvo-faktorska avtentikacija</q> je postopek s katerim povečamo stopnjo varnosti na PBX sistemu.  Vsaka uporabniška prijava bo preverjena na dveh ločenih sistemih.  Npr. uporabnik mora vnesti pravo geslo in hkrati potrditi prijavo preko e-poštnega sporočila - če je že prijavljen na drugi napravi - pa mora potrditi prijavi na tej napravi. Predlagamo, da se vedno uporablja dvo-faktorsko avetentikacijo!\r\n</dd>",
