        "info8_email": "E-poštni-račun\r\n<p>\r\nTu nastavljaš E-poštni račun, s katerim ti lahko PBX pošilja sporočila.  \r\n<dl>\r\n<dt>SMTP Strežnik</dt>\r\n<dd>Hostname ali IP naslov strežnika za odhodno pošto (<q>SMTP-Strežnik</q>)</dd>\r\n<dt>E-poštni naslov</dt>\r\n<dd>Naslov s katerega bodo poslani taka e-poštna sporočila. Tu lahko vnesetu tudi svoj lastni e-poštni naslov.</dd>\r\n<dt>E-pošta uporabniško ime</dt>\r\n<dd>Uporabniško ime uporabnika e-pošte.</dd>\r\n<dt>E-poštno geslo</dt>\r\n<dd>Geslo uporabnika e-poštnega računa.</dd>\r\n<dt>Ime pošiljatelja</dt>\r\n<dd>Poljubno ime, ki se bo prikazalo pri poslanih sporočilih.</dd>\r\n</dl>\r\nE-pošta-preizkusi pošiljanje\r\n<p>\r\nZa potrditev pravilnih nastavitev lahko tu pošlješ testno sporočilo.\r\n<dl>\r\n<dt>E-poštni naslov prejemnika</dt>\r\n<dd>E-poštni naslov prejemnika tega testnega sporočila.</dd>\r\n</dl>",
