        "info0_network": "Ajustes de red\r\n<p><p>\r\nSi su dispositivo recibe un lease de un servidor DHCP, todas las opciones de configuración incluídas en el lease se mostrarán como valores por defecto. \r\n<dl>\r\n<dt>Dirección IPv4</dt><dd>La dirección IPv4 de la primera interfaz (ETH0). Por favor, asegúrese de que la dirección especificada no está siendo utilizada ya en su red. \r\n<p><p>\r\nSi deja el campo de la dirección vacío, la PBX obtendrá su dirección IP y posiblemente más opciones a través de DHCP. En ese caso, asegúrese de que una <q>reserva</q> ha sido creada para el dispositivo en su servidor DHCP.  Esto es importante porque la dirección no puede cambiar con el tiempo. La dirección MAC de la PBX es el <q>número de serie</q> impreso en el dispositivo. \r\n</dd>\r\n<dt>Máscara de red IPv4</dt><dd>La máscara de subred de la interfaz ETH0 (p.ej. <code>255.255.255.0</code>)</dd>\r\n<dt>Router estándar</dt><dd>El router estándar de su red.  El tráfico IP para los destinos desconocidos por la PBX será enviado ahí</dd>\r\n<dt>Dirección del servidor DNS</dt><dd>El servidor para la resolución de nombres de dominio de su red. La PBX enviará todos los nombres (p.ej. los servicios o los nombres de proveedores SIP) al servidor DNS, el cual se ocupará de devolver una dirección IP.</dt>\r\n<dt>Dirección servidor NTP</dt><dd>El servidor de hora de su red (p.ej. <code>pool.ntp.org</code>). La PBX no funcionará correctamente sin un servidor de hora apropiado \r\n</dd>\r\n</dl>\r\n\r\n",
        "info0_update": "Actualizar\r\n<ul>\r\nseleccione la versión del Firmware a instalar\r\n</ul>",
        "info0_devices": "Añadir a la instalación existente\r\n<ul>\r\nNombre de ruta si las aplicaciones no deben ser instaladas en este dispositivo sino en otra App Plataform (p.ej., <code> https://miPBXcentral/App/</ code>\r\n</ul>",
        "info0_localap": "Instalar App Platform local\r\n<dl>\r\n<dt>Dirección IPv4</dt>\r\n<dd>\r\nDirección IP de la nueva app platform.\r\n<p><p>Si deja el campo de la dirección vacío, la App Platform obtendrá su dirección IP y posiblemente más ajustes de configuración via DHCP. En ese caso, por favor asegúrese de que una <q>reserva</q> para su App Platform ha Sido creada en su servidor DHCP. Esto es importante porque la dirección no puede cambiar con el tiempo.  La dirección MAC de la App Platform es el <q>Número de serie</q> impreso en el dispositivo con los dos primeros dígitos <code>00</code> reemplazados por <code>02</code>. \r\n</dd>\r\n</dl>\r\n<p><p>\r\nLa App Platform siempre requiere una dirección IP propia.",
        "info1_appconnect": "App Platform setup\r\n<ul>\r\nLa App Platform está siendo instalada, esto puede tardar un rato....\r\n</ul>",
        "info2_deviceslogin": "Info deviceslogin",
        "info3_pbxadmin": "Primera cuenta de usuario con derechos de administrador\r\n<p>\r\nConfigure la cuenta del primer usuario que tendrá derechos de administrador. Este puede ser usted mismo, por ejemplo. \r\n<dl>\r\n<dt>Nombre de Usuario</dt>\r\n<dd>El nombre completo y único del usuario, por ejemplo, su  nombre y apellidos.</dd>\r\n<dt>Dirección de email</dt>\r\n<dd>La dirección de email que puede ser usada para enviar emails al usuario. Por ejemplo, su propia dirección de email.</dd>\r\n<dt>Cuenta</dt><dd>El nombre para iniciar sesión. Puede usar aquí la parte local de su dirección de correo (esto es, todo lo que antecede a <q>@</q>). Mayúsculas y caracteres especiales no están permitidos, sólo las letras de la \"a\" a la \"z\", cifras de 0 a 9 y los caracteres .!#$%&'*+-/=?^_`{|}~ están permitidos.</dd>\r\n<dt>Contraseña</dt><dd>Contraseña para iniciar sesión.</dd>\r\n</dl>",
        "info3_pbxident": "Identificación de la PBX\r\n<dl><dt>\r\nNombre del dominio\r\n</dt><dd>\r\nIntroduzca el <q>nombre del dominio</q> del cliente aquí.  Las letras de la a a la z, cifras de 0 a 9, y los caracteres . y - están permitidos (no mayúsculas)\r\n</dd><dt>\r\nNombre localización PBX\r\n</dt><dd>\r\nEspecifica la localización de la PBX. Aquí tiene sentido el nombre de una población como por ejemplo <q>berlin</q>.  Como con el nombre del dominio, las letras de la a a la z, cifras de 0 a 9, y los caracteres . y - están permitidos (no mayúsculas)\r\n</dd>\r\n</dl>",
        "info3_pbxdns": "Nombres de dominio\r\n<p>\r\nLos nombres DNS para la PBX y la APP Platform configurados en su servidor DNS.\r\n<p>\r\nLa instalación verificará que esos nombres se hayan configurado en su servidor DNS y que apuntan al dispositivo correcto (es decir, la dirección IP). Si aún no están configurados en su DNS, puede dejarlos vacíos y continuar con la instalación. Sin embargo, recomendamos tenerlos configurados antes, para que pueda estar seguro de que todo está correcto y funciona.\r\n<dl>\r\n<dt> Nombre DNS de esta PBX </ dt>\r\n<dd> El nombre DNS que se configuró para la PBX. Debe apuntar a la dirección IP de su PBX. Recomendamos que utilice los valores predeterminados que se muestran para el nombre DNS. En cualquier caso, solo las letras de la \"a\" a la \"z\", cifras de 0 a 9 y los caracteres \".\" y \"-\" están permitidos (sin mayúsculas). </ dd>\r\n<dt> Nombre DNS de la App Platform</ dt>\r\n<dd> El nombre DNS que se ha configurado para la App Platform. Debe apuntar a la dirección IP de su App Platform. En cuanto a la PBX, solo las letras de la \"a\" la \"z\", cifras de 0 a 9 y los caracteres \".\" y \"-\" están permitidos (sin mayúsculas) </ dd>\r\n</ dl>\r\nSi se ha modificado la entrada DNS en su servidor DNS, es muy posible que la caché DNS de su navegador y su sistema operativo deban ser borradas para que el cambio tenga efecto en la instalación.",
        "info3_pbxvoicemail": "Seleccione qué idiomas serán utilizados por el buzón de correo. Instale sólo aquellos que realmente usa el cliente.",
        "info4_showpwd": "Seleccione y copie las contraseñas (p.ej. en un editor de texto) y guárdelas en un lugar seguro. Estas contraseñas sólo están pensadas para casos de emergencia y, por lo tanto, son expresiones complejas aleatoriamente codificadas. El acceso normal del administrador es a través de las credenciales de administrador.",
        "info5_installing": "Algunas Apps importantes están siendo instaladas ahora - esto puede tardar un rato...",
