        "twofactorauth": "Verificación en dos pasos",
        "info7_twofactorauth": "Verificación en dos pasos\r\n<dd>\r\nLa <q>verificación en dos pasos</q> es un método para mejorar el nivel de seguridad de la PBX. Cada inicio de sesión del usuario será verificado mediante dos pasos independientes.  Por ejemplo, esto puede ser una contraseña en combinación con un email de verificación o, si ya a iniciado sesión en otro dispositivo, confirmar el nuevo inicio de sesión en ese dispositivo. ¡Siempre recomendamos activar la verificación en dos pasos!\r\n<dd>",
